def sum_of_divisors_in_range(n):
    if n < 7:
        return 0
    elif n == 7 or n == 8:
        return n
    else:
        divisors = []
        for i in range(1, n+1):
            if n % i == 0 and 7 <= i <= 8:
                divisors.append(i)
        return sum(divisors)
